  &quot;my daughter&quot;
  &quot;remember us&quot;
  &quot;Not a Wildabeast. - I know&quot; (LOL that one cracked me up)
  woofbark &quot;God Bless You&quot; (like it had sneezed LOL)
  &quot;purples on it&quot;
  &quot;how clever he&#39;s been&quot;

  anyway im attaching them because they are very clear to me just like &quot;Listen to those dogs&quot;

  I liked that session... you should get the dogs to join in more often LOL they change the energy of the session.

  Misty
